import React from 'react'
import ReactDOM from 'react-dom'
import Square from './Square'

const Board = () => {
    // const newSquare(number) {
    //     return <Square/>
    // }
    
    return (
        <div className="board">
            <Square/>  
            <Square/>  
            <Square/>  
            <Square/>  
            <Square/>  
            <Square/>  
            <Square/>  
            <Square/>  
            <Square/>
            <Square/>
        </div>
    )
}

export default Board
